import { Col, Form, Row } from "react-bootstrap";

const Contact = () => {
    return (
        <div>
            <h1>Get in Touch</h1>
            <div className="contact" style={{width:"40%"}}>
            <Form>
                <Row>
                    <Form.Label>Name</Form.Label>
                    <Col>
                        <Form.Control placeholder="First name" />
                    </Col>
                    <Col>
                        <Form.Control placeholder="Last name" />
                    </Col>
                </Row>
            </Form>
            </div>
        </div>
    );
}

export default Contact;
